import React from 'react';

const Navbar = () => {
  const [isMenuOpen, setMenuOpen] = React.useState(false);

  const handleMenuToggle = () => {
    setMenuOpen(!isMenuOpen);
  };

  return (
    <nav className="navbar" style={{ backgroundColor: 'red' }}>
      <div className="navbar-left">
        <img src="/path/to/main-logo.png" alt="Main Logo" className="navbar-logo" />
        <div className="navbar-mobile-menu" onClick={handleMenuToggle}>
          <img
            src="/path/to/triple-line-logo.png"
            alt="Triple Line Logo"
            className="navbar-mobile-logo"
          />
        </div>
      </div>
      <div className={`navbar-menu ${isMenuOpen ? 'active' : ''}`}>
        <ul className="navbar-list">
          <li className="navbar-item">Option 1</li>
          <li className="navbar-item">Option 2</li>
          <li className="navbar-item">Option 3</li>
          <li className="navbar-item">Option 4</li>
          <li className="navbar-item">Option 5</li>
          <li className="navbar-item navbar-item-right">Logout</li>
        </ul>
      </div>
      {isMenuOpen && (
        <div className="navbar-dropdown">
          <ul className="navbar-dropdown-list">
            <li className="navbar-dropdown-item">Option 1</li>
            <li className="navbar-dropdown-item">Option 2</li>
            <li className="navbar-dropdown-item">Option 3</li>
            <li className="navbar-dropdown-item">Option 4</li>
            <li className="navbar-dropdown-item">Option 5</li>
            <li className="navbar-dropdown-item navbar-dropdown-item-right">Logout</li>
          </ul>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
